},"metadata":{},"output_type":"display_data"}],"source":["# This R environment comes with many helpful analytics packages installed\n","# It is defined by the kaggle/rstats Docker image: https://github.com/kaggle/docker-rstats\n","# For example, here's a helpful package to load\n","\n","library(tidyverse) # metapackage of all tidyverse packages\n","\n","# Input data files are available in the read-only \"../input/\" directory\n","# For example, running this (by clicking run or pressing Shift+Enter) will list all files under the input directory\n","\n","list.files(path = \"../input\")\n","\n","# You can write up to 20GB to the current directory (/kaggle/working/) that gets preserved as output when you create a version using \"Save & Run All\" \n","# You can also write temporary files to /kaggle/temp/, but they won't be saved outside of the current session"]},{"cell_type":"markdown","id":"19b2c427","metadata":{"papermill":{"duration":0.010174,"end_time":"2023-02-14T12:45:57.498868","exception":false,"start_time":"2023-02-14T12:45:57.488694","status":"completed"},"tags":[]},"source":["---\n","title: \"Coursera Cyclistic\"\n","author: \"Melissa Lapinski\"\n","date: \"2023-01-23\"\n","output: html_document\n","---"]},{"cell_type":"markdown","id":"f682fd52","metadata":{"papermill":{"duration":0.010593,"end_time":"2023-02-14T12:45:57.520328","exception":false,"start_time":"2023-02-14T12:45:57.509735","status":"completed"},"tags":[]},"source":["\n","# Cyclistic Analysis 2022\n","\n","## Scenario  \n","\n","This is a case study for the fictional bike-sharing company in Chicago, Cyclistic. Cyclistic offers different types of bikes, and different types of passes.  The director of marketing believes the company's future success depends on maximizing the number of annual memberships instead of the single-ride, or full-day passes, which are grouped into \"casual\" riders.\n","\n","## Ask  \n","\n","Three questions will guide the future marketing program:  \n","  1. How do annual members and casual riders use Cyclistic bikes differently?  \n","  2. Why would casual riders buy Cyclistic annual memberships?  \n","  3. How can Cyclistic use digital media to influence casual riders to become members?  \n","  \n","### Business Task  \n","As the junior data analyst, it is my job to answer the first question - How do annual members and casual riders use Cyclistic bikes differenly?\n","\n","### Stakeholders  \n","● Lily Moreno: The director of marketing and your manager. Moreno is responsible for the development of campaigns\n","and initiatives to promote the bike-share program. These may include email, social media, and other channels.   \n","● Cyclistic marketing analytics team: A team of data analysts who are responsible for collecting, analyzing, and\n","reporting data that helps guide Cyclistic marketing strategy. You joined this team six months ago and have been busy\n","learning about Cyclistic’s mission and business goals — as well as how you, as a junior data analyst, can help Cyclistic\n","achieve them.  \n","● Cyclistic executive team: The notoriously detail-oriented executive team will decide whether to approve the\n","recommended marketing program.  \n","\n","## Prepare  \n","\n","I have downloaded each of the 12 cvs files from Motivate International Inc., under this [license](https://ride.divvybikes.com/data-license-agreement).  Each file is the data for 1 month of the year 2022. I will add the data here after I load the packages I will need."]},{"cell_type":"code","execution_count":2,"id":"4f809ba1","metadata":{"execution":{"iopub.execute_input":"2023-02-14T12:45:57.572532Z","iopub.status.busy":"2023-02-14T12:45:57.543981Z","iopub.status.idle":"2023-02-14T12:45:57.63342Z","shell.execute_reply":"2023-02-14T12:45:57.631569Z"},"papermill":{"duration":0.103647,"end_time":"2023-02-14T12:45:57.635632","exception":false,"start_time":"2023-02-14T12:45:57.531985","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"strea