7th St through Ellis Ave & 60th St     5544         \n","4  Ellis Ave & 60th St through Ellis Ave & 55th St          5278         \n","5  Ellis Ave & 55th St through Ellis Ave & 60th St          4745         \n","6  State St & 33rd St through Calumet Ave & 33rd St         3268         \n","7  Calumet Ave & 33rd St through State St & 33rd St         3215         \n","8  Loomis St & Lexington St through Morgan St & Polk St     2891         \n","9  Morgan St & Polk St through Loomis St & Lexington St     2876         \n","10 University Ave & 57th St through NA                      2371         \n","11 University Ave & 57th St through Kimbark Ave & 53rd St   2267         \n","12 NA through University Ave & 57th St                      2095         \n","13 Loomis St & Lexington St through Halsted St & Polk St    2091         \n","14 Kimbark Ave & 53rd St through University Ave & 57th St   2059         \n","15 Ellis Ave & 60th St through NA                           1998         \n","16 Ellis Ave & 60th St through Ellis Ave & 58th St          1942         \n","17 NA through Ellis Ave & 60th St                           1879         \n","18 Ellis Ave & 55th St through Kimbark Ave & 53rd St        1816         \n","19 Ellis Ave & 58th St through Ellis Ave & 60th St          1796         \n","20 NA through Kedzie Ave & Milwaukee Ave                    1776         "]},"metadata":{},"output_type":"display_data"}],"source":["top_member <- head(arrange (top_member_rides, desc(number_of_rides)), 20)\n","\n","head(top_member, 20)\n"]},{"cell_type":"markdown","id":"22a5dad0","metadata":{"papermill":{"duration":0.018302,"end_time":"2023-02-14T12:49:54.92031","exception":false,"start_time":"2023-02-14T12:49:54.902008","status":"completed"},"tags":[]},"source":["It seems that the start and end station are usually the same for casual riders, but they are different for the members.\n","\n","\n","## Share\n","\n","Here are my findings about the way casual riders and annual riders use the bikes.\n","\n","* Annual members have a much higher number of rides per day on Monday through Friday.  Casuals have higher numbers than annual riders on the weekends.\n","\n","* Casual riders have over twice the average duration of rides over the annual members.  This is true all week, with even higher differences on the weekends.\n","\n","* The number of annual riders per month is higher every month over the casual riders, with bigger differences Sept - April.\n","\n","* The ride duration is still longer for the casual riders, even in the winter months.\n","\n","* The casual riders prefer electric bikes over classic, and both of those much more than docked bikes.\n","\n","* The members prefer the classic bikes, but only slightly over the electric bikes.\n","\n","* The start and end station is the same for half of the casual riders on the most popular routes, while it is different for most of the member riders.  Is this because the casual rider doesn't realize they can return it to another station?  Could that also be why their rides are longer?  These are things to look into when trying to come up with a marketing plan.\n"]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":242.80694,"end_time":"2023-02-14T12:49:55.360113","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2023-02-14T12:45:52.553173","version":"2.4.0"}},"nbformat":4,"nbformat_minor":5}